Description:
Οι άνθρωποι που επαγγέλονταν την ελπίδα και τη σωτηρία της χώρας καταλήγουν, όπως φαίνεται, να πλήξουν καίρια την ανταγωνιστικότητα της ελληνικής οικονομίας. 
15%, 18%, 23% στο ΦΠΑ; 
Πολύ απλά η ελληνική οικονομία δεν αντέχει μια τέτοια φοροκαταιγίδα, όταν εμείς είχαμε καταφέρει να βγάλουμε τη χώρα στα πλεονάσματα. 
Ας μας πούνε: Έχουν και άλλες τέτοιες φαεινές ιδέες;
